func TestZstdEncode(t *testing.T) {
	in := []byte(originalJson)
	encode, err := ZstdEncode(in)
	if err != nil {
		panic(err)
	}

	decode, err := ZstdDecode(encode)
	if err != nil {
		panic(err)
	}
	t.Logf("input: %d, encode: %d, rate: %.2f%%\r\n", len(in), len(encode), float64(len(encode))/float64(len(in)))
	assert.Condition(t, func() (success bool) {
		return string(in) == string(decode)
	})
}
